BEGIN TRANSACTION;
CREATE TABLE roles (
	id SERIAL NOT NULL, 
	name VARCHAR(64), 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE customers (
	id SERIAL NOT NULL, 
	code VARCHAR, 
	name VARCHAR, 
	PRIMARY KEY (id)
);
CREATE TABLE users (
	id SERIAL NOT NULL, 
	email VARCHAR(64), 
	username VARCHAR(64), 
	name VARCHAR(150), 
	user_pin VARCHAR(10), 
	role_id INTEGER, 
	password_hash VARCHAR(128), 
	PRIMARY KEY (id), 
	FOREIGN KEY(role_id) REFERENCES roles (id)
);
CREATE TABLE app_users (
	id SERIAL NOT NULL, 
	username VARCHAR(64), 
	first_name VARCHAR(64), 
	last_name VARCHAR(64), 
	phone_number VARCHAR(20), 
	app_password VARCHAR(64), 
	user_id INTEGER, 
	role_id INTEGER, 
	draft_date TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	FOREIGN KEY(role_id) REFERENCES roles (id)
);
CREATE TABLE drivers (
	id SERIAL NOT NULL, 
	first_name VARCHAR(64), 
	last_name VARCHAR(64), 
	phone_number VARCHAR(20), 
	draft_date TIMESTAMP, 
	user_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE factories (
	id SERIAL NOT NULL, 
	code VARCHAR(10), 
	name VARCHAR(64), 
	user_id INTEGER, 
	draft_date TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE seasons (
	id SERIAL NOT NULL, 
	code VARCHAR(10), 
	name VARCHAR(64), 
	user_id INTEGER, 
	draft_date TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE produce (
	id SERIAL NOT NULL, 
	code VARCHAR(10), 
	name VARCHAR(64), 
	user_id INTEGER, 
	cess FLOAT, 
	draft_date TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE vehicles (
	id SERIAL NOT NULL, 
	reg_no VARCHAR(10), 
	make VARCHAR(64), 
	body VARCHAR(64), 
	color VARCHAR(64), 
	ownership VARCHAR(5), 
	user_id INTEGER, 
	draft_date TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE routes (
	id SERIAL NOT NULL, 
	code VARCHAR(10), 
	name VARCHAR(64), 
	user_id INTEGER, 
	draft_date TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
CREATE TABLE trips (
	id SERIAL NOT NULL, 
	status VARCHAR(20), 
	total_weight_collected FLOAT, 
	total_weight_received FLOAT, 
	has_collections BOOLEAN, 
	user_id INTEGER, 
	grader_id INTEGER, 
	vehicle_id INTEGER, 
	driver_id INTEGER, 
	route_id INTEGER, 
	draft_date TIMESTAMP, 
	last_updated TIMESTAMP, 
	PRIMARY KEY (id), 
	CHECK (has_collections IN ('0', '1')), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	FOREIGN KEY(grader_id) REFERENCES app_users (id), 
	FOREIGN KEY(vehicle_id) REFERENCES vehicles (id), 
	FOREIGN KEY(driver_id) REFERENCES drivers (id), 
	FOREIGN KEY(route_id) REFERENCES routes (id)
);
CREATE TABLE collection_centres (
	id SERIAL NOT NULL, 
	code VARCHAR(10), 
	name VARCHAR(64), 
	user_id INTEGER, 
	route_id INTEGER, 
	draft_date TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	FOREIGN KEY(route_id) REFERENCES routes (id)
);
CREATE TABLE farmers (
	id SERIAL NOT NULL, 
	supplier_no VARCHAR(20), 
	first_name VARCHAR(64), 
	last_name VARCHAR(64), 
	id_number INTEGER, 
	phone_number VARCHAR(20), 
	user_id INTEGER, 
	centre_id INTEGER, 
	draft_date TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	FOREIGN KEY(centre_id) REFERENCES collection_centres (id)
);
CREATE TABLE contracts (
	id SERIAL NOT NULL, 
	farmer_id INTEGER, 
	produce_id INTEGER, 
	contract_no VARCHAR(20), 
	payment_term VARCHAR(20), 
	user_id INTEGER, 
	factory_id INTEGER, 
	valid_from TIMESTAMP, 
	valid_to TIMESTAMP, 
	draft_date TIMESTAMP, 
	price FLOAT NOT NULL, 
	active BOOLEAN, 
	PRIMARY KEY (id), 
	FOREIGN KEY(farmer_id) REFERENCES farmers (id), 
	FOREIGN KEY(produce_id) REFERENCES produce (id), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	FOREIGN KEY(factory_id) REFERENCES factories (id), 
	CHECK (active IN ('0', '1'))
);
CREATE TABLE collections (
	id SERIAL NOT NULL, 
	device_imei VARCHAR(50), 
	transfer_code VARCHAR(50), 
	receipt_no VARCHAR(50), 
	user_id INTEGER, 
	centre_id INTEGER, 
	farmer_id INTEGER, 
	produce_id INTEGER, 
	trip_id INTEGER, 
	produce_weight FLOAT, 
	collection_date TIMESTAMP, 
	draft_date TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES app_users (id), 
	FOREIGN KEY(centre_id) REFERENCES collection_centres (id), 
	FOREIGN KEY(farmer_id) REFERENCES farmers (id), 
	FOREIGN KEY(produce_id) REFERENCES produce (id), 
	FOREIGN KEY(trip_id) REFERENCES trips (id)
);
CREATE TABLE trip_payments (
	id SERIAL NOT NULL, 
	status VARCHAR(20), 
	rate FLOAT, 
	weight FLOAT, 
	kdb FLOAT, 
	gross FLOAT, 
	net FLOAT, 
	is_paid BOOLEAN, 
	user_id INTEGER, 
	trip_id INTEGER, 
	contract_id INTEGER, 
	farmer_id INTEGER, 
	draft_date TIMESTAMP, 
	delivery_date TIMESTAMP, 
	last_updated TIMESTAMP, 
	PRIMARY KEY (id), 
	CHECK (is_paid IN ('0', '1')), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	FOREIGN KEY(trip_id) REFERENCES trips (id), 
	FOREIGN KEY(contract_id) REFERENCES contracts (id), 
	FOREIGN KEY(farmer_id) REFERENCES farmers (id)
);
CREATE UNIQUE INDEX ix_users_email ON users (email);
CREATE UNIQUE INDEX ix_users_username ON users (username);
CREATE UNIQUE INDEX ix_app_users_username ON app_users (username);
CREATE UNIQUE INDEX ix_app_users_phone_number ON app_users (phone_number);
CREATE UNIQUE INDEX ix_drivers_phone_number ON drivers (phone_number);
CREATE UNIQUE INDEX ix_factories_code ON factories (code);
CREATE UNIQUE INDEX ix_factories_name ON factories (name);
CREATE UNIQUE INDEX ix_seasons_name ON seasons (name);
CREATE UNIQUE INDEX ix_seasons_code ON seasons (code);
CREATE UNIQUE INDEX ix_produce_code ON produce (code);
CREATE UNIQUE INDEX ix_produce_name ON produce (name);
CREATE UNIQUE INDEX ix_vehicles_reg_no ON vehicles (reg_no);
CREATE UNIQUE INDEX ix_routes_code ON routes (code);
CREATE UNIQUE INDEX ix_routes_name ON routes (name);
CREATE INDEX ix_trips_status ON trips (status);
CREATE UNIQUE INDEX ix_collection_centres_code ON collection_centres (code);
CREATE UNIQUE INDEX ix_collection_centres_name ON collection_centres (name);
CREATE UNIQUE INDEX ix_farmers_supplier_no ON farmers (supplier_no);
CREATE UNIQUE INDEX ix_contracts_contract_no ON contracts (contract_no);
COMMIT;
